import React from "react";
import Topnav from "../../components/navigasi/Topnav";
import Sidenav from "../../components/navigasi/Sidenav";

const Antrian = () => {
  return (
    <div className="wrapper">
      <Topnav />
      <Sidenav />
      <div className="content-wrapper"></div>
    </div>
  );
};

export default Antrian;
